import './dropDown.css';
import './dropDownBreak.css';

const DropDown = ()=>{

    const toHome = ()=>{
        const dd = document.querySelector(".dropdown");
        dd.style.transform =  "translateY(-100vh)";
    }

    return(
        <div className="dropdown">
            <ul>
                <li onClick={toHome}>Home</li>
                <li>About</li>
                <li>Skills</li>
                <li>Contact</li>
            </ul>
        </div>
    );
}

export default DropDown;
